import React, { Component } from 'react'

export default class Navigation extends Component {
    constructor() {
        super()
        this.state = {
            links: ['About Natours','Your benefits','Popular tours','Stories','Book Now']
        }
    }
    render() {
        return(<div className='navigation'>
            <input className='navigation__checkbox' type='checkbox' id='navi-toggle'/>
            <label className='navigation__button' htmlFor='navi-toggle'>menu</label>
            <div className='navigation__background'>&nbsp;</div>
            <nav className='navigation__nav'>
                <ul className='navigation__list'>
                    {this.state.links.map((item,i) => <li className='navigation__link' key={i}>
                        <a className='navigation__item' href='#nav'>{item}</a>
                    </li>)}
                </ul>
            </nav>
        </div>)
    }
}
